import React, { Component } from "react";
import {  NavLink, withRouter, Link } from "react-router-dom";
import { connect } from "react-redux";
import { logoutUser } from "../../actions/authActions";

import "./Sidenav.css";
import logo from "../../images/logo2.jpg";

class SideNav extends Component {
  onLogoutClick = e => {
    this.props.logoutUser(this.props.history);
    window.location.href = "/";
  };

 
  render() {
  
    const { user } = this.props.auth;
    return (
      <div id="sidebar-collapse" class="col-sm-3 col-lg-2 sidebar">
      <div class="profile-sidebar">
        <div class="profile-userpic">
          <img src={logo} class="img-responsive" alt=""/>
        </div>
        <div class="profile-usertitle">
          <div class="profile-usertitle-name">Username</div>
          <div class="profile-usertitle-status"><span class="indicator label-success"></span>Online</div>
        </div>
        <div class="clear"></div>
      </div>
      <div class="divider"></div>
      <form role="search">
        <div class="form-group">
          <input type="text" class="form-control" placeholder="Search"/>
        </div>
      </form>
      <ul class="nav menu">
        <li class="active"><a href="index.html"><em class="fa fa-dashboard">&nbsp;</em> Dashboard</a></li>
        <li><a href="Home.html"><em class="fa fa-home">&nbsp;</em> Home</a></li>
        <li><a href="investor.html"><em class="fa fa-line-chart">&nbsp;</em> Investor Relation</a></li>
        <li><a href="members.html"><em class="fa fa-users">&nbsp;</em> Members</a></li>
        <li><a href="downloadables.html"><em class="fa fa-download">&nbsp;</em> Downloadables</a></li>
        <li><a href="login.html"><em class="fa fa-power-off">&nbsp;</em> Logout</a></li>
      </ul>
    </div>
    );
  }
}
const mapStateToProps = state => ({
  projects: state.projects,
  auth: state.auth
});

export default withRouter(
  connect(
    mapStateToProps,
    { logoutUser }
  )(withRouter(SideNav))
);
